خدام جداول الجمع أو الضرب للحساب في الحياة اليومية. مثلا:  يوجد 4 صفوف من 6 الواح  شوكولا في هذه العلبة . كم  يبلغ عدد ألواح الشوكولا في العلبة؟</span></strong></p>\\n\\n<p> </p>\\n\\n<p style=\\\"text-align:center\\\"><strong><span style=\\\"font-size:1.25em\\\">- استخدام الأعداد  لمقارنة الكميات. مثلا: عمرك 9 سنوات وفادي عمره 13 سنة.ما هو فارق العمر بينكما؟</span></strong></p>\\n\\n<p style=\\\"text-align:center\\\"><strong><span style=\\\"font-size:1.25em\\\"> انتبه ! ليست كل صعوبة في الرياضيات هي حتما عسر  الحساب </span></strong></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"07e920e5-7927-466d-909c-bc2f7ad6f764\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":70,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":32.928942807626,\"y\":83.076923076923,\"width\":30.101302460203,\"height\":13.714285714286,\"goToSlide\":1,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"next\",\"invisible\":false,\"title\":\"السؤال التالي\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":0,\"y\":0,\"width\":97.092288242731,\"height\":99.550561797753,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAHx8AABGECAYAAACUqFfOAAAACXBIWXMAAC4jAAAuIwF4pT92AAAgAElEQVR42uzdQQHAIADEsDH/ng8Z9JFIqIGebfsAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACA534JAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAoMF8HAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACLMxwEAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACDCfBwAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAizMcBAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAgwnwcAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAIszHAQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAIMJ8HAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACLMxwEAAAAAAAAAAAAAAAA
